import React,{Component} from 'react'
import {Route} from 'react-router-dom';
import index1 from '../action/index1';
import Hello from'../components/Users'
import Hi from '../components/Friends';



class Content extends Component {
    render() {
    return (
          <div className='item2'>
          <center><label>Contents</label></center>
          <Route path="/" exact component={Hello,index1}/> 
          <Route path="/Hi"  component={Hi}/>
        </div>
    
        );
    }
  }
  // const mapDispatchToProps = (dispatch) =>{
  //   return{getData: () => dispatch (getData())}
  // };
export default Content
